jobs_results.description:
Poszukujemy rzetelnych i pracowitych osób na stanowisko Android Developer, które chcą dołączyć do zespołu, gdzie liczy się zaangażowanie, współpraca i solidne wykonanie powierzonych zadań. Jeśli szukasz stabilnej pracy, cenisz sobie dobre warunki zatrudnienia i możliwość zdobycia doświadczenia w dynamicznym środowisku, ta oferta jest dla Ciebie!. Obowiązki:
• Dbanie o jakość i rozwój aplikacji mobilnych;
• Tworzenie aplikacji napisanej w 100% w Kotlinie 1.3, z minSDK = 23;
• Współdecydowanie o użytych technologiach i dalszych kierunkach rozwoju;
• Korzystanie z fastlane, modułów Gradle, Android Architecture Components, constraint layout, vector drawables, RxJava2, coroutines, Koin, Retrofit 2, Glide;
• Code-review w Bitbucket i praca na wielu gałęziach rozwojowych;
• Automatyzacja procesów wydawniczych, dbanie o analizę statyczną i testy;
• Praca w sprintach, udział w refinementach, demo, retrospekcjach.

. Aplikuj do Nas, jeśli:
• Masz min. 2 lata doświadczenia jako Android Developer;
• Potrafisz pisać solidny i czytelny kod;
• Znasz Kotlina w stopniu umożliwiającym swobodne pisanie kodu;
• Wiesz co to Material Design i potrafisz implementować podstawowe komponenty z użyciem Design support;
• Masz doświadczenie w pisaniu aplikacji zgodnie z architekturą MVVM;
• Rozumiesz jak działa i potrafisz korzystać z REST API;
• Jesteś odpowiedzialny i dobrze organizujesz swój czas;
